integration_05:
node DataNode {
    has id: int;
    has data: str;
}

walker CRUDWalker {
    has operation: str;
    has node_id: int;
    has data: str;

    def create() {
        new_node = DataNode(id=self.node_id, data=self.data);
        root ++> new_node;
        save(new_node);
    }

    def read() {
        for node in [root-->] {
            if node.id == self.node_id {
                report node.data;
            }
        }
    }

    def update() {
        for node in [root-->] {
            if node.id == self.node_id {
                node.data = self.data;
                save(node);
            }
        }
    }

    def delete() {
        for node in [root-->] {
            if node.id == self.node_id {
                root del --> node;
            }
        }
    }

    can execute with entry {
        if self.operation == "create" {
            self.create();
        } elif self.operation == "read" {
            self.read();
        } elif self.operation == "update" {
            self.update();
        } elif self.operation == "delete" {
            self.delete();
        }
    }
}
